import { useState } from 'react';
import Carousel from 'react-bootstrap/Carousel';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../styles/App.css'; // Import the correct CSS path

// Ensure that the component is exported properly
function CustomCarousel() {
  const [index, setIndex] = useState(0);

  const handleSelect = (selectedIndex) => {
    setIndex(selectedIndex);
  };

  return (
    <Carousel activeIndex={index} onSelect={handleSelect} interval={null} pause={null}>
      <Carousel.Item>
        <div className="d-block w-100 h-100">
          <h3>Blank Slide</h3>
        </div>
      </Carousel.Item>

      <Carousel.Item>
        <div className="d-block w-100 h-100">
          <h3>Blank Slide</h3>
        </div>
      </Carousel.Item>

      <Carousel.Item>
        <div className="d-block w-100 h-100">
          <h3>Blank Slide</h3>
        </div>
      </Carousel.Item>

      {/* Left arrow */}
      <a className="carousel-control-prev" href="#carouselExampleControls" role="button" data-slide="prev">
        <span className="carousel-control-prev-icon" aria-hidden="true"></span>
        <span className="sr-only">Previous</span>
      </a>

      {/* Right arrow */}
      <a className="carousel-control-next" href="#carouselExampleControls" role="button" data-slide="next">
        <span className="carousel-control-next-icon" aria-hidden="true"></span>
        <span className="sr-only">Next</span>
      </a>
    </Carousel>
  );
}

// Export the component correctly
export default CustomCarousel;
